import React from "react";
import {Link} from "react-router-dom";

const ForgotPassword = () => {

    return (
        <div className="login_form-wrapper">
            <h2 className='login_header'>Forgot your password?</h2>
            <p className='login_subtext'>Enter your details below and get back on track!</p>
            <label htmlFor="email">Your email</label>
            <input className='login-field_email'
                   type="email"
                   id="email" name="email"
                   placeholder="Email Address"
            />
            <button className='login-button_submit' type="submit">
                Reset Password
            </button>
            <Link to="/"> Oh! I remember my password! </Link>
        </div>
    )
};

export default ForgotPassword;
